import React from 'react';
import {Route, Switch} from 'react-router-dom';
import DvMenu from '../DVComponents/dvmenu';
import Login from '../DVComponents/login';
import {ProtectedRoute} from '../DVControllers/ProtectedRouter';
class App extends React.PureComponent<{}> {
    constructor(props){
        super(props);
        this.state = {LoggedIn: 0};
    }
    row = () => {
        var rows = [];
        var comp = <DvMenu/>;
        for (let i = 0; i<2; i++) {
            rows.push(comp);
        }
        return rows;
     }
    public render() {
        return (
            <div>
                <Switch>
                    <ProtectedRoute exact path="/app" component ={DvMenu}></ProtectedRoute>
                    <Route exact path="*" component ={Login}></Route>
                </Switch>
            </div>
        );
    }
}

export default App;
